import './App.css';
import Header from './Components/Header';
import Details from './Components/Details';
import Webflow from './Components/Webflow';
import Footer from './Components/Footer';

function App() {
  return (<>
    <Header />
    <Details />
    <Webflow />
    <Footer />
  </>);
}

export default App;
